import reactlogo from '../logo192.png'
const cards = [
    {
        name: 'first',
        title:'Первый видос',
        id:1,
    },
    {
        name: 'Second',
        title:'Второй видос',
        id:2,
    },
    {
        name: 'Third',
        title:'Третий видос',
        id:3,
    },
    {
        name: 'Fourth',
        title:'Четвёртый видос',
        id:4,
    }
];
export function Card (){
    return(
    <>
        {cards.map(card => {
        return(
        <div className='card' key={card.id}>
            <img src={reactlogo} alt="" />
            <p>{card.name}</p>
            <p>{card.title}</p>     
        </div>)
        })}
    </>
    )
}
